
#
# TABLE STRUCTURE FOR: member
#

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
                          `id` varchar(255) NOT NULL,
                          `email` varchar(255) NOT NULL,
                          `name` varchar(255) NOT NULL,
                          `password` varchar(255) NOT NULL,
                          `username` varchar(255) NOT NULL,
                          PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


#
# TABLE STRUCTURE FOR: activity
#

DROP TABLE IF EXISTS `activity`;

CREATE TABLE `activity` (
                            `id` varchar(255) NOT NULL,
                            `averageSpeed` double NOT NULL,
                            `distance` double NOT NULL,
                            `elevation` double NOT NULL,
                            `movingTime` varchar(255) NOT NULL,
                            `member_id` varchar(255) NOT NULL,
                            PRIMARY KEY (`id`),
                            KEY `member_id` (`member_id`),
                            CONSTRAINT `activity_ibfk_1` FOREIGN KEY (`member_id`) REFERENCES `member` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




#
# TABLE STRUCTURE FOR: community
#

DROP TABLE IF EXISTS `community`;

CREATE TABLE `community` (
                             `id` varchar(255) NOT NULL,
                             `name` varchar(255) NOT NULL,
                             `description` varchar(255) NOT NULL,
                             PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




#
# TABLE STRUCTURE FOR: post
#

DROP TABLE IF EXISTS `post`;

CREATE TABLE `post` (
                        `id` varchar(255) NOT NULL,
                        `date` datetime NOT NULL,
                        `text` text NOT NULL,
                        `community_id` varchar(255) NOT NULL,
                        `writer_id` varchar(255) NOT NULL,
                        `activity_id` varchar(255) DEFAULT NULL,
                        PRIMARY KEY (`id`),
                        KEY `community_id` (`community_id`),
                        KEY `writer_id` (`writer_id`),
                        KEY `activity_id` (`activity_id`),
                        CONSTRAINT `post_ibfk_1` FOREIGN KEY (`community_id`) REFERENCES `community` (`id`),
                        CONSTRAINT `post_ibfk_2` FOREIGN KEY (`writer_id`) REFERENCES `member` (`id`),
                        CONSTRAINT `post_ibfk_3` FOREIGN KEY (`activity_id`) REFERENCES `activity` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


#
# TABLE STRUCTURE FOR: comment
#

DROP TABLE IF EXISTS `comment`;

CREATE TABLE `comment` (
                           `id` varchar(255) NOT NULL,
                           `date` datetime NOT NULL,
                           `text` text NOT NULL,
                           `member_id` varchar(255) NOT NULL,
                           `post_id` varchar(255) NOT NULL,
                           PRIMARY KEY (`id`),
                           KEY `member_id` (`member_id`),
                           KEY `post_id` (`post_id`),
                           CONSTRAINT `comment_ibfk_1` FOREIGN KEY (`member_id`) REFERENCES `member` (`id`),
                           CONSTRAINT `comment_ibfk_2` FOREIGN KEY (`post_id`) REFERENCES `post` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: likes_table
#

DROP TABLE IF EXISTS `likes_table`;

CREATE TABLE `likes_table` (
                               `id` varchar(255) NOT NULL,
                               `comment_id` varchar(255) DEFAULT NULL,
                               `post_id` varchar(255) DEFAULT NULL,
                               PRIMARY KEY (`id`),
                               KEY `comment_id` (`comment_id`),
                               KEY `post_id` (`post_id`),
                               CONSTRAINT `likes_table_ibfk_1` FOREIGN KEY (`comment_id`) REFERENCES `comment` (`id`),
                               CONSTRAINT `likes_table_ibfk_2` FOREIGN KEY (`post_id`) REFERENCES `post` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: reward
#

DROP TABLE IF EXISTS `reward`;

CREATE TABLE `reward` (
                          `id` varchar(255) NOT NULL,
                          `name` varchar(255) NOT NULL,
                          `requirements` text NOT NULL,
                          `type` varchar(255) NOT NULL,
                          `community_id` varchar(255) NOT NULL,
                          PRIMARY KEY (`id`),
                          KEY `community_id` (`community_id`),
                          CONSTRAINT `reward_ibfk_1` FOREIGN KEY (`community_id`) REFERENCES `community` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

